import React from 'react';
import logo from '../images/logo.png';

class Navigation extends React.Component {
    render(){
        return <div className="Navigation"> 
                <div className="Logo">
                    <img className="logo-image"src={logo} alt="Oops."/>
                </div>
                <div className="Tabs">
                    {this.props.name}
                </div>
                </div>
                ;
    }
}
export default Navigation;
